DESCRIPTION:
{
    "tittle": "Wheatfield under Thunderclouds",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " Auvers-sur-Oise",
        "date": " July 1890"
    },
    "description": {
        "medium": "oil on canvas",
        "dimensions": "50.4 cm x 101.3 cm"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "In the last weeks of his life, Van Gogh completed a number of impressive paintings of the wheatfields around Auvers. This outspread field under a dark sky is one of them. In these landscapes he tried to express 'sadness, extreme loneliness'. But the overwhelming emotions that Van Gogh experienced in nature were also positive. He wrote to his brother Theo, 'I'd almost believe that these canvases will tell you what I can't say in words, what I consider healthy and fortifying about the countryside. 'The elongated format of Wheatfields under Thunderclouds is unusual. It emphasizes the grandeur of the landscape, as does the simple composition: two horizontal planes.",
        "references": []
    }
}

