DESCRIPTION:
{
    "tittle": "Wheatfield with Crows",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " Auvers-sur-Oise",
        "date": " July 1890"
    },
    "description": {
        "medium": "oil on canvas",
        "dimensions": "50.5 cm x 103 cm"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "Wheatfield with Crows is one of Van Gogh's most famous paintings. It is often claimed that this was his very last work. The menacing sky, the crows and the dead-end path are said to refer to the end of his life approaching. But that is just a persistent myth. In fact, he made several other works after this one. Van Gogh did want his wheatfields under stormy skies to express 'sadness, extreme loneliness', but at the same time he wanted to show what he considered 'healthy and fortifying about the countryside'. Van Gogh used powerful colour combinations in this painting: the blue sky contrasts with the yellow-orange wheat, while the red of the path is intensified by the green bands of grass.",
        "references": [
            {
                "text": "'healthy and fortifying about the countryside'.",
                "link": "http://www.vangoghletters.org/vg/letters/let898/letter.html"
            }
        ]
    }
}

