DESCRIPTION:
{
    "tittle": "Tree Roots",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " Auvers-sur-Oise",
        "date": " July 1890"
    },
    "description": {
        "medium": "oil on canvas",
        "dimensions": "50.3 cm x 100.1 cm"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "This painting seems at first sight to consist of a jumble of bright colours and fanciful abstract forms. Only after that do you realise that it shows a slope with tree trunks and roots. These are trees used for timber, growing in a marl quarry. Such quarries could be found around Auvers (FR). The work was not entirely completed. That explains its unfinished appearance. It is probably Van Gogh's very last painting. Andries Bonger, the brother-in-law of Vincent's brother Theo, described it in a letter: 'The morning before his death, he had painted a sous-bois [forest scene], full of sun and life. '",
        "references": []
    }
}

