    },
    "content": {
        "text": "'What a fine sight an old working man makes, in his patched bombazine suit with his bald head, ' Van Gogh wrote about this drawing. The artist had a penchant for working-class figures, marked by life, and the title Worn Out emphasizes the dramatic element of his chosen theme. This tired, bent old man lived at the Dutch Reformed Almshouse for Men and Women in The Hague. Residents of the home posed for Van Gogh in old, worn-out clothing in return for a small payment. Van Gogh made dozens of large figure drawings in The Hague, in which he practised representing human proportions, poses and facial expressions.",
        "references": [
            {
                "text": "Van Gogh wrote",
                "link": "http://vangoghletters.org/vg/letters/let286/letter.html"
            }
        ]
