DESCRIPTION:
{
    "tittle": "The Rock of Montmajour with Pine Trees",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " Arles",
        "date": " July 1888"
    },
    "description": {
        "medium": "pencil",
        "dimensions": " pen"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "Van Gogh drew this jagged rock with pine trees using a reed pen – a drawing tool that lent itself to supple and vigorous lines. He developed his own drawing style with it, consisting of stipples and stripes in all sizes, thicknesses and directions. Van Gogh made this drawing on the hill of Montmajour, near Arles. His fascination with the landscape around the hill inspired a series of pen drawings, which form a high point in his oeuvre. He accepted the fierce mistral wind and the many mosquitoes as the price he had to pay. 'If a view makes one forget those little vexations, there must be something in it, ' he wrote to his brother Theo.",
        "references": [
            {
                "text": "he wrote",
                "link": "http://vangoghletters.org/vg/letters/let639/letter.html"
            }
        ]
    }
}

