{
    "tittle": "Garden of the Hospital",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " Arles",
        "date": " May 1889"
    },
    "description": {
        "medium": "pencil",
        "dimensions": " reed pen and pen and brush and ink"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "For months, Van Gogh looked out over this courtyard of the hospital in Arles. That was in the spring of 1889. He drew the lush garden while staying there for treatment of his mental condition. Van Gogh drew with a reed pen, filling almost the entire page. It takes a while before you notice that a few figures are visible. There are people in the upper left, on the upstairs gallery. And on the far side of the garden, there are two nuns. As if it were a puzzle, he placed his signature on a watering can on the lower right, in front of the tall tree.",
        "references": []
    }
}

