    },
    "content": {
        "text": "Van Gogh was allowed to use this room with a barred window as a studio in the hospital in Saint-Rémy. The window looks out over the walled garden. Pots and bottles stand on the windowsill. Several of Van Gogh's own paintings hang on either side of the window. Van Gogh began by setting out his design in black chalk. Then he developed the drawing further using thinned oil paint and a little watercolour. Between the bars and the blue of the sky he left the paper visible, which adds depth to the scene.",
