    },
    "content": {
        "text": "In May 1889, Van Gogh had himself admitted to the psychiatric hospital in Saint-Rémy because of his fragile mental health. At first he was not allowed to leave the walled grounds of the institution. Fortunately, the overgrown garden offered him plenty of inspiration. This drawing is a realistic representation of that garden.",
