DESCRIPTION:
{
    "tittle": "Old Vineyard with Peasant Woman",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " Auvers-sur-Oise",
        "date": " May 1890"
    },
    "description": {
        "medium": "pencil",
        "dimensions": " brush and oil paint and watercolour"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "Van Gogh focused on painting in the final months of his life. He completed only a few large, finished drawings, including this one of a vineyard in Auvers. We find the same wavy lines in his late paintings. Van Gogh began with a pencil drawing. Then he added oil paint and watercolour in many different shades of blue. He painted some of the roofs red, but these have since faded to brown. Because he left large areas of the paper blank, the colour white plays a large role in the scene.",
        "references": []
    }
}

