DESCRIPTION:
{
    "tittle": "Cottages",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " Nieuw Amsterdam",
        "date": " September-November 1883"
    },
    "description": {
        "medium": "oil on canvas",
        "dimensions": "35.4 cm x 55.7 cm"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "Van Gogh painted Cottages in 1883, while staying in the village of Nieuw-Amsterdam in Drenthe. He wrote enthusiastically to his brother how ‘inexpressibly beautiful’ it was there. But, he added, ‘you can’t see that yet in my studies at all’. He still had ‘to learn a lot more’. In this picture, he is practising how to convey the contrast between a dark foreground and a light sky. The paint on this canvas contains a lot of sand. It must have blown onto it while Van Gogh was working outdoors. If you zoom in, you can see the bright grains against the dark paint.",
        "references": []
    }
}

