        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "From early in his career, Van Gogh was fascinated by simple cottages and farmsteads like this. He painted them frequently during the two months that he spent in Drenthe in 1883. Here, Van Gogh has worked with little precision, using broad brushes. Even so, he has provided just enough details to convey the main characteristics of the farm. On the right side of the roof are two projecting beams. They are supporting the roof, made of sods and moss.",
