DESCRIPTION:
{
    "tittle": "Still Life with Earthenware and Bottles",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " Nuenen",
        "date": " September-October 1885"
    },
    "description": {
        "medium": "oil on canvas",
        "dimensions": "40.1 cm x 56.3 cm"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "This still life is made up of everyday objects that were probably used in the Van Gogh household. In 1885, Van Gogh was living with his parents in Nuenen (NL), where he made this painting. He used a canvas on which he had previously painted a woman at work. An X-ray image brought that fact to light. The background in this still life is almost the same colour as the three bottles. Van Gogh used white paint to add light accents to the bottles – highlights. This makes them stand out from the background.",
        "references": []
    }
}

