DESCRIPTION:
{
    "tittle": "The Cottage",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " Nuenen",
        "date": " May 1885"
    },
    "description": {
        "medium": "oil on canvas",
        "dimensions": "65.7 cm x 79.3 cm"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "The old cottage beneath the red evening sky presents an idyllic picture of rural life. Van Gogh called these humble farmhouses 'people's nests'. He felt they had a sheltering quality. This cottage contains two houses with two front doors and a shared chimney. That type of dwelling was then on the brink of disappearing. 'The thing struck me greatly; those two cottages, half decayed under one and the same thatched roof, reminded me of a couple of worn-out old folk who make up just one single being and whom one sees supporting each other, ' he wrote. The subject continued to fascinate him. Four years later, in France, he returned to drawing and painting old houses. Over the years, however, his style of painting had changed significantly: by that time, he used bright colours and loose brushwork.",
        "references": [
            {
                "text": "he wrote",
                "link": "http://www.vangoghletters.org/vg/letters/let506/letter.html"
            }
        ]
    }
}

