DESCRIPTION:
{
    "tittle": "The Old Church Tower at Nuenen ('The Peasants' Churchyard')",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " Nuenen",
        "date": " May-June 1885"
    },
    "description": {
        "medium": "oil on canvas",
        "dimensions": "65 cm x 80 cm"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "Van Gogh lived near this ruined church tower in Nuenen, in the Dutch province of North Brabant. The tower had remained standing when the church collapsed a century earlier, but at the time of this painting it was being demolished. The steeple is already gone. In a letter to his brother Theo, Vincent explained what he wanted this painting to express. He saw the dilapidated church tower as a symbol of the ephemeral nature of religion. In his eyes, it formed a stark contrast with the country graveyard next to it. There, farmers lay buried in the same soil they once had tilled. This showed that their lives were rooted in the eternal truths of death and rebirth.",
        "references": [
            {
                "text": "Vincent explained",
                "link": "http://vangoghletters.org/vg/letters/let507/letter.html"
            }
        ]
    }
}

