DESCRIPTION:
{
    "tittle": "Basket of Apples",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " Nuenen",
        "date": " September 1885"
    },
    "description": {
        "medium": "oil on canvas",
        "dimensions": "45.0 cm x 60.4 cm"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "In a letter to his brother Theo, Vincent explained exactly why he had chosen certain colour contrasts in this still life. For example, he used red accents in the apples alongside 'greenish things'. Red and green form a pair of what are known as complementary colours. Pairs like these form the basis of the colour theory of Eugène Delacroix (1798-1863), an artist Van Gogh greatly admired. Vincent studied handbooks of colour and applied what he learned in his art. Theo was also gradually learning more about the subject, as shown by Vincent's somewhat cynical remark: 'well observed – but – did you come up with that on your own???'.",
        "references": [
            {
                "text": "'greenish things'",
                "link": "http://vangoghletters.org/vg/letters/let536/letter.html"
            },
            {
                "text": "complementary colours",
                "link": "https://www.vangoghmuseum.nl/en/stories/looking-for-contrast#3"
            },
            {
                "text": "Vincent's somewhat cynical remark",
                "link": "Http://vangoghletters.org/vg/letters/let536/letter.html"
            }
        ]
    }
}

