    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "This is one of the still lifes that Van Gogh made in September 1885. He wanted to see what would happen if you used multiple shades of the same colour in a single painting. Here he used the ochre colour terra sienna. If you zoom in on this painting, you'll see how Van Gogh suggested the wickerwork of the basket. Look, for instance, at the vertical stalks of reed on the left side of the basket, the most brightly lit side. Only small bits of these stalks are visible. Van Gogh rendered these with yellowish-green dots of paint, which he squeezed directly out of the tube onto the canvas.",
        "references": []
    }
}

