{
    "tittle": "Self-Portrait",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " Paris",
        "date": " July-August 1887"
    },
    "description": {
        "medium": "oil on canvas",
        "dimensions": "43.2 cm x 31.3 cm"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "Van Gogh has painted this self-portrait in a multitude of blues. Not only the background, but also his face: even the whites of his eyes are blue. He painted the self-portrait on the back of a still life because he couldn’t afford any new canvas. Previously, he had sometimes obtained painting materials on credit or in exchange for paintings. He got them from Père Tanguy, owner of a Parisian art supplies shop. But Tanguy’s wife put a stop to that. Vincent wrote angrily to his brother Theo, describing her as an ‘old witch’.",
        "references": []
    }
}

