    },
    "content": {
        "text": "For a while, Van Gogh was fascinated with birds' nests. In 1885, he made them the subject of five still lifes in a row. He wrote to his brother Theo that he thought these would appeal to nature lovers, 'because of the colours of the moss, dry leaves and grasses, clay &c. '. Earlier that summer, Vincent had told Theo how he got the nests. He had gone out with a peasant boy to look for them. They found six, 'from which the young had already flown, so that one could take them without too many pangs of conscience. '",
