{
    "tittle": "Bobbin Winder",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " Nuenen",
        "date": " March-April 1885"
    },
    "description": {
        "medium": "oil on canvas",
        "dimensions": "34.0 cm x 44.3 cm"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "Anton Kerssemakers, an amateur painter who took lessons from Van Gogh, recalled that Vincent’s studio was full of objects including ‘all kinds of mosses and plants brought along from the moor, some stuffed birds, a spool, a spinning wheel . . . ’ The ‘spool’ might have been this bobbin winder – a device used to wind spun thread onto a bobbin or spool. Weavers in Van Gogh’s time were already working with mechanically spun thread, but the thread was still spooled manually.",
        "references": []
    }
}

