    "content": {
        "text": "This house is the vicarage where Van Gogh's parents lived in Nuenen, in the Dutch province of North Brabant. He painted it after returning home to stay with them for a while. The vicarage is still standing. The atmosphere in the Van Gogh home was often strained; Vincent was quick to take offence at his father's remarks. He had the feeling his family consisted mainly of 'people who keep up a position', he wrote. He didn't fit in, as 'a peasant painter – who doesn't think about it'.",
        "references": [
            {
                "text": "he wrote",
                "link": "http://vangoghletters.org/vg/letters/let493/letter.html"
            }
        ]
