DESCRIPTION:
{
    "tittle": "Head of a Prostitute",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " Antwerp",
        "date": " December 1885"
    },
    "description": {
        "medium": "oil on canvas",
        "dimensions": "35.2 cm x 24.4 cm"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "By choosing this contemporary subject, Van Gogh presented himself as a modern painter of city life. That included the margins of society and the prostitutes who lived there. This woman may not look like a prostitute at first glance. But in the nineteenth century, loose hair was a sign of loose morals. Van Gogh used rough brushstrokes to paint her face. He succeeded in giving her features volume and life.",
        "references": []
    }
}

