DESCRIPTION:
{
    "tittle": "Portrait of a Prostitute",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " Antwerp",
        "date": " December 1885"
    },
    "description": {
        "medium": "oil on canvas",
        "dimensions": "46.3 cm x 38.5 cm"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "With her hair in a bun and her jewellery, this woman looks perfectly respectable to us. But to Van Gogh's contemporaries, her low-cut dress and eye makeup told a different story. Van Gogh painted this woman shortly after moving to Antwerp (BE). He needed models so that he could practise portrait painting. Only 'ladies of easy virtue' could be persuaded to pose for a painter they had never met before. Van Gogh painted this portrait in a single sitting. For the glittering earring, Van Gogh used a thick blob of pinkish-white paint that later fell off.",
        "references": []
    }
}

