DESCRIPTION:
{
    "tittle": "Self-Portrait with Felt Hat",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " Paris",
        "date": " December 1886-January 1887"
    },
    "description": {
        "medium": "oil on canvas",
        "dimensions": "41.5 cm x 32.5 cm"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "In this self-portrait, Van Gogh is wearing a black felt hat, an overcoat and a tie (cravat). He looks like a respectable gentleman. An X-ray image of this work makes it clear that Van Gogh painted it over another painting. He had made that earlier study – of a standing nude woman – in the atelier of Fernand Cormon (1845-1924) in Paris. He took lessons there in the spring of 1886. Instead of scraping off the painting beneath this one, he painted his self-portrait over it. He did, however, cover the woman with a new ground layer first.",
        "references": []
    }
}

