DESCRIPTION:
{
    "tittle": "Head of a Skeleton with a Burning Cigarette",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " Antwerp",
        "date": " January-February 1886"
    },
    "description": {
        "medium": "oil on canvas",
        "dimensions": "32.3 cm x 24.8 cm"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "This skeleton with a lit cigarette in its mouth is a juvenile joke. Van Gogh painted it in early 1886, while studying at the art academy in Antwerp. The painting shows that he had a good command of anatomy. Drawing skeletons was a standard exercise at the academy, but painting them was not part of the curriculum. He must have made this painting at some other time, between or after his lessons.",
        "references": []
    }
}

