DESCRIPTION:
{
    "tittle": "Torso of Venus",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " Paris",
        "date": " June 1886"
    },
    "description": {
        "medium": "oil on cardboard",
        "dimensions": "46.0 cm x 38.0 cm"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "Van Gogh was thorough in everything he did. So when he decided to practise painting plaster models of classical sculptures, he immediately produced a whole series. He painted this torso of Venus five times, in each case from a different angle. This time he has turned the model to face away from him. He has used a lot of paint and followed the curves of the body with his brush.",
        "references": [
            {
                "text": "this torso of Venus",
                "link": "https://www.vangoghmuseum.nl/en/collection/s0199V1962"
            }
        ]
    }
}

