    },
    "content": {
        "text": "Van Gogh didn’t have to walk far to reach this quarry. It was just around the corner from the flat where he lived with his brother Theo. Vincent painted a number of pictures at this spot. The quarry in the rue Caulaincourt provided stone for the multitude of construction projects in Paris. It was at the bottom of the hill of Montmartre, on the side not yet built-up. Nowadays, the street is in the middle of a residential area.",
