DESCRIPTION:
{
    "tittle": "Path in Montmartre",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " Paris",
        "date": " April-May 1886"
    },
    "description": {
        "medium": "oil on cardboard",
        "dimensions": "22.2 cm x 16.3 cm"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "This is one of the first paintings that Van Gogh produced in Paris. He painted it outdoors, probably on Montmartre. Only one side of the hill was built-up at that time. The exact location is now impossible to identify. The small painting was to become a family favourite. Vincent’s sister-in-law, Jo van Gogh-Bonger (Theo’s widow), kept it standing on her mantelpiece. And her son, Vincent Willem, who founded the Van Gogh Museum, later had it hanging in his home.",
        "references": []
    }
}

