    "content": {
        "text": "In 1886, when Van Gogh lived in Paris, he made a large number of flower still lifes. Basket of Pansies is one of them. He hoped that paintings of this kind would attract buyers, but he had little luck selling them. The basket is on a stool shaped like a tambourine. Such stools could be found in the Café du Tambourin on Boulevard de Clichy in Paris. Van Gogh was a regular there. For a couple of months, he even had a relationship with the Italian owner, Agostina Segatori. The same stools are also visible in the portrait he painted of her.",
        "references": [
            {
