DESCRIPTION:
{
    "tittle": "Apples",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " Paris",
        "date": " September-October 1887"
    },
    "description": {
        "medium": "oil on canvas",
        "dimensions": "45.7 cm x 60.4 cm"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "The foreground and background compete for attention in this still life. It's an explosion of colour. The background includes just about every variety of blue and green on Van Gogh’s palette. Over that, he added brushstrokes in contrasting colours: yellow, orange, red and pink. He used these same colour combinations for the apples in the foreground, but in the opposite order: the warm tones first, followed by cool green and blue accents. This created unity in the scene.",
        "references": []
    }
}

