        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "Van Gogh always managed to find new subjects for his still lifes. Here he used shellfish. After painting them, he probably had them for supper that same day. His friend and fellow painter Paul Gauguin (1848-1903) saw this small painting. Years later, he mentioned it when writing about his memories of Van Gogh. Gauguin said that Van Gogh had sold the painting to a dealer for five francs and given away the money immediately afterwards to a poor young woman in the street.",
        "references": []
    }
}

