DESCRIPTION:
{
    "tittle": "View of Paris",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " Paris",
        "date": " June-July 1886"
    },
    "description": {
        "medium": "oil on canvas",
        "dimensions": "53.9 cm x 72.8 cm"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "From the hill of Montmartre, Van Gogh painted the southerly view of Paris. He created depth in the composition by making the roofs and chimneys in the foreground seem close by. Further away, the outlines of monumental buildings are visible in the city centre. Panthéon, Louvre, Notre Dame; all of them have been identified. Van Gogh made the buildings fairly large and detailed in proportion to the rest of the landscape. He probably used a telescope. There are still telescopic viewers on the hill so that tourists can take in the view.",
        "references": []
    }
}

