DESCRIPTION:
{
    "tittle": "Self-Portrait",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " Paris",
        "date": " July-August 1887"
    },
    "description": {
        "medium": "oil on canvas",
        "dimensions": "42.2 cm x 34.5 cm"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "When he had no access to models, Van Gogh regularly painted himself. During the summer of 1887, he actually produced a whole series of self-portraits. The formal jacket he wears in this painting is an exception. In most of them he is wearing his artist’s smock. This is one of Van Gogh’s ‘double-sided’ paintings. To save money, he has painted this self-portrait on the back of another painting. He was broke. Research has revealed that he was using a cheap paintbrush that was losing its hairs: they are still embedded in the paint.",
