DESCRIPTION:
{
    "tittle": "Square Saint-Pierre at Sunset",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " Paris",
        "date": " May 1887"
    },
    "description": {
        "medium": "oil on canvas on carton",
        "dimensions": "33.0 cm x 42.0 cm"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "It takes a while to figure out what makes this painting so unusual. Van Gogh made the sky largely yellow and the foreground blue. This was his way of suggesting the fall of night. The three figures between the trees are no more than silhouettes. The painting clearly shows that Square Saint-Pierre in Paris was a fairly new park in Van Gogh's day. The trees are still young. Now called Square Louise-Michel, it leads up to the Sacré Coeur Basilica, one of the city's most famous churches. The basilica was then under construction.",
        "references": []
    }
}

