DESCRIPTION:
{
    "tittle": "Flame Nettle in a Flowerpot",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " Paris",
        "date": " June-July 1886"
    },
    "description": {
        "medium": "oil on canvas",
        "dimensions": "42.1 cm x 21.9 cm"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "The subject could hardly be more domestic: a pot plant like this is something you expect to see on a windowsill, not in a Van Gogh painting. But he painted the flame nettle as a colour study. He has used what are called ‘complementary colours’. For instance, the mainly rusty orange leaves are set against the contrasting blue of the background. And he has deliberately placed occasional green and red accents next to each other on the stem of the plant and elsewhere. Colour pairs of this kind are basic to the colour theory of French artist Eugène Delacroix (1798-1863). Van Gogh was a great admirer of Delacroix.",
        "references": [
            {
                "text": "‘complementary colours’",
                "link": "https://www.vangoghmuseum.nl/en/stories/looking-for-contrast"
            }
        ]
    }
}

