DESCRIPTION:
{
    "tittle": "Bank of the Seine",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " Paris",
        "date": " May-July 1887"
    },
    "description": {
        "medium": "oil on canvas",
        "dimensions": "32.0 cm x 46.0 cm"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "Van Gogh preferred the countryside to the city, so he liked to paint outdoors in the summer on the banks of the Seine, just outside Paris. He painted small studies that were easy to carry, like this one. In this small painting, Van Gogh experimented with the stippling technique of the Pointillists, but he did so in his own way. He used long dashes for the water, small dots for the trees and plants, and larger brushstrokes for the sky. With this technique, he beautifully captured the reflection of the riverbanks in the water.",
        "references": []
    }
}

