    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "During his time in Paris, Van Gogh often carried his field easel and painting materials around with him. He was always in search of interesting subjects. Here he found a spot by the river Seine. Van Gogh first sketched the river scene in pencil on the canvas. The pencil lines are still clearly visible in some places; he didn't paint over all of them. They are especially clear along the horizon. Look at the straight lines directly above the blue of the river. The painting is unfinished. He may have intended to complete the sketch in his studio, but he never got around to it.",
        "references": []
    }
}

