DESCRIPTION:
{
    "tittle": "Trees and Undergrowth",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " Paris",
        "date": " July 1887"
    },
    "description": {
        "medium": "oil on canvas",
        "dimensions": "46.2 cm x 55.2 cm"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "In Paris, Van Gogh experimented with the Pointillist stippling technique. This woodland scene is a good example. He covered the entire canvas with small dots of paint. The result is a play of light and shadow on the ground between the trees. The strip of yellow in the middle suggests the sunlight of a clearing in the distance. Along with the tree trunk on the right, it brings depth to the scene. Van Gogh drew strength from nature: 'Sometimes it's precisely those spots where one no longer feels anything of what's known as the civilized world . . . sometimes it's precisely those spots that one needs to achieve calm. '",
        "references": [
            {
                "text": "Van Gogh drew strength from nature",
                "link": "http://www.vangoghletters.org/vg/letters/let369/letter.html"
            }
        ]
    }
}

