DESCRIPTION:
{
    "tittle": "Wheatfield with Partridge",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " Paris",
        "date": " June-July 1887"
    },
    "description": {
        "medium": "oil on canvas",
        "dimensions": "53.7 cm x 65.2 cm"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "Amid the waving wheat, we see poppies and cornflowers. A partridge emerges from the field and flies away. Looking at this painting, you feel as if you're right next to the field. That's because of the low point of view. Van Gogh painted this rural wheat field while living in the crowded city of Paris. Before his move to the French capital, his main theme had been country life. For him, this summery painting was a brief return to that theme.",
        "references": []
    }
}

