DESCRIPTION:
{
    "tittle": "Montmartre: Behind the Moulin de la Galette",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " Paris",
        "date": " July 1887"
    },
    "description": {
        "medium": "oil on canvas",
        "dimensions": "81 cm x 100 cm"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "This is one of the largest landscapes in Van Gogh's oeuvre. He chose a subject close to home, the hill of Montmartre in Paris, and painted the view from the hill to the northwest. In the distance, the hills of Meudon are visible. There are allotment gardens in the foreground. Van Gogh used a variety of brushwork here over a light ground, from light strokes to quick dashes and specks of paint. The influence of the Impressionists is clear from the bright colours and loose painting technique.",
        "references": []
    }
}

