DESCRIPTION:
{
    "tittle": "Carafe and Dish with Citrus Fruit",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " Paris",
        "date": " February-March 1887"
    },
    "description": {
        "medium": "oil on canvas",
        "dimensions": "46.3 cm x 38.4 cm"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "Painting a glass object is difficult. Van Gogh made the challenge even greater, choosing an elaborate carafe and decorative wallpaper. This made it necessary for him to render the colourful reflections in the glass. The tabletop underneath the dish of lemons is tilted upward. This is not a mistake, but a choice. Van Gogh was trying out a perspective technique he had learned from Japanese woodcuts. Their strong diagonals fascinated him. Vincent signed and dated this still life. He did that only when he was satisfied with his work.",
        "references": []
    }
}

