DESCRIPTION:
{
    "tittle": "View from Theo's Apartment",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " Paris",
        "date": " March-April 1887"
    },
    "description": {
        "medium": "oil on canvas",
        "dimensions": "45.9 cm x 38.1 cm"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "Van Gogh lived with his brother Theo after arriving in Paris. In June 1886, they moved into an apartment on Rue Lepic. Theo described its fine views of the city in a letter. He concluded, 'The different effects produced by atmospheric variations make it a subject for I don't know how many paintings. 'Van Gogh adopted an unusual approach to this view. On part of the canvas, he used the stippling technique he had learned from the Pointillists. He painted other parts loosely and freely. He probably felt that laying down the little dots was too rigid and time-consuming. It was out of keeping with his spontaneous way of painting.",
        "references": []
    }
}

