DESCRIPTION:
{
    "tittle": "Impasse des Deux Frères",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " Paris",
        "date": " February-April 1887"
    },
    "description": {
        "medium": "oil on canvas",
        "dimensions": "35.0 cm x 65.5 cm"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "Van Gogh painted this scene of a street in the middle of the lively Montmartre district. The unpaved street has stone gutters, represented by blue stripes. The mill on wheels in the centre was probably a movable billboard. There were several real mills on the hill of Montmartre in Paris, and one is visible in the background (the Moulin à Poivre). In Van Gogh's day, these mills were no longer in operation but served as an entertainment venue and tourist attraction. The entrances were decorated with flags.",
        "references": []
    }
}

