DESCRIPTION:
{
    "tittle": "Piles of French Novels",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " Paris",
        "date": " October-November 1887"
    },
    "description": {
        "medium": "oil on canvas",
        "dimensions": "54.4 cm x 73.6 cm"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "This still life is an ode to modern French literature. The books with yellow covers are not immediately identifiable to 21st-century viewers. But Van Gogh's contemporaries recognised them as modern French paperbacks. Van Gogh was an avid reader and an admirer of novelists such as the Goncourt brothers and Emile Zola. They offered a realistic, unvarnished perspective on modern life. The open book in the foreground invites the viewer to come and read.",
        "references": []
    }
}

