DESCRIPTION:
{
    "tittle": "Portrait of Léonie Rose Charbuy-Davy",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " Paris",
        "date": " March-April 1887"
    },
    "description": {
        "medium": "oil on canvas",
        "dimensions": "60.7 cm x 45.7 cm"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "Much as Van Gogh would have liked to paint more portraits, he didn’t often get the chance. In the spring of 1887, he had the opportunity to paint a young Parisian woman called Léonie Rose Charbuy-Davy. She was the niece of art dealer Pierre Firmin Martin, who sometimes exhibited Van Gogh’s paintings. She is sitting by the fire, next to a baby’s cradle. The fire casts a red glow on the floor. The shape of the rest of the room is not entirely clear.",
        "references": []
    }
}

