DESCRIPTION:
{
    "tittle": "Flowering Plum Orchard (after Hiroshige)",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " Paris",
        "date": " October-November 1887"
    },
    "description": {
        "medium": "oil on canvas",
        "dimensions": "55.6 cm x 46.8 cm"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "Van Gogh was a great admirer of Japanese art. He wrote that it made him happy and cheerful. He made three paintings after Japanese prints from his own collection. This gave him a chance to explore the Japanese printmakers' style and use of colour. The first of these copies is based on Utagawa Hiroshige's Plum Garden in Kameido. Van Gogh accurately reproduced the composition but made the colours much more intense. He replaced the black and grey of Hiroshige's tree trunk with red and blue tones. He also added the two orange borders with Japanese characters for a decorative and exotic effect.",
        "references": [
            {
                "text": "He wrote",
                "link": "http://vangoghletters.org/vg/letters/let686/letter.html"
            },
            {
                "text": "the Japanese printmakers' style and use of colour",
                "link": "https://www.vangoghmuseum.nl/en/stories/inspiration-from-japan"
            },
            {
                "text": "Plum Garden in Kameido",
                "link": "https://www.vangoghmuseum.nl/en/collection/n0077V1962"
            }
        ]
    }
}

