DESCRIPTION:
{
    "tittle": "Red Cabbages and Onions",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " Paris",
        "date": " October-November 1887"
    },
    "description": {
        "medium": "oil on canvas",
        "dimensions": "50.2 cm x 64.3 cm"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "Van Gogh could not have chosen a simpler subject: some onions and a few red cabbages. But by working with colour contrasts, he was able to turn them into something special. It's important to realise that the colours in this still life have changed over time. The tablecloth is now greyish-blue but was originally purple. That formed a strong contrast with the yellow of the onions and of the right upper background.",
        "references": []
    }
}

