DESCRIPTION:
{
    "tittle": "Quinces, Lemons, Pears and Grapes",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " Paris",
        "date": " September-October 1887"
    },
    "description": {
        "medium": "oil on canvas",
        "dimensions": ""
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "When Van Gogh saw the work of modern French artists in Paris, he realised he would have to change the dark Dutch colours he used in his paintings. He showed with this still life that he was a genuine colourist, working almost exclusively with shades of yellow, as well as a little green, blue, red and pink. He used threads of wool to try out colour combinations before beginning to paint. Van Gogh also painted the frame of this work. It is the only original frame that has survived. He dedicated the painting to Theo, who had frequently encouraged him to add more colour to his work.",
        "references": [
            {
                "text": "colours he used",
                "link": "https://www.vangoghmuseum.nl/en/stories/looking-for-contrast"
            }
        ]
    }
}

