DESCRIPTION:
{
    "tittle": "View of a Butcher's Shop",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " Arles",
        "date": " February 1888"
    },
    "description": {
        "medium": "oil on canvas on cardboard",
        "dimensions": "39.7 cm x 33.1 cm"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "This is the first painting made by Van Gogh after his arrival in Arles (FR). He painted it in the Carrel hotel and restaurant at 30, Rue Amédée Pichot. For the first few months of his time in Arles, he rented a room there. We look outside through the door. There is snow on the street. The sun is shining, making the scene sparkle. Across the street is the butcher shop. On the shop front, the name 'Reboul Charcutier' is visible. On the right of the shop window, sausages have been hung to dry.",
        "references": []
    }
}

