DESCRIPTION:
{
    "tittle": "An Old Woman of Arles",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " Arles",
        "date": " February 1888"
    },
    "description": {
        "medium": "oil on canvas",
        "dimensions": "58 cm x 42 cm"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "Van Gogh painted this woman while staying in the Carrel hotel in the southern French city of Arles. It is probably Elisabeth Garcin, the hotel owner's mother-in-law. She was 68 years old at the time. The knotted black kerchief on her head was a typical part of a widow's mourning dress. Part of a bed can be seen in the background. Throughout his life, Van Gogh liked to paint things and people that bore the marks of a hard life. This figure study can be seen in that context.",
        "references": []
    }
}

