DESCRIPTION:
{
    "tittle": "The White Orchard",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " Arles",
        "date": " April 1888"
    },
    "description": {
        "medium": "oil on canvas",
        "dimensions": "60 cm x 81 cm"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "The perspective chosen by Van Gogh guides your gaze upward into the tangle of branches. Looking at the painting, you feel as if you are in the middle of the flowering trees. Soon after Van Gogh arrived in Arles, the spring came. There were many fruit orchards around the city. He enthusiastically painted a large series of studies of orchards in blossom. These plum trees were poorly maintained, as their long branches show. Van Gogh was especially fond of timeworn trees like these.",
        "references": []
    }
}

