    },
    "content": {
        "text": "The gnarled trunk and branches of this small pear tree stand out against the light background. Van Gogh was captivated by the flowering fruit trees in Provence, so he made a whole series of paintings of trees in blossom. Van Gogh was a great admirer of Japanese printmaking and drew inspiration from it. Japanese artists often took spring blossoms as their subject. But Van Gogh adopted more than just their subject matter. The composition of his painting also shows a Japanese influence, with the small tree in the foreground and the high viewpoint.",
