    },
    "content": {
        "text": "For this farmhouse in a field near Arles (FR), Van Gogh used bright, unmixed colours. This work illustrates what he had learned in Paris. There he had encountered a variety of new art movements, including Impressionism and Pointillism. As soon as he arrived in the southern city of Arles, he began painting his surroundings. He tried to use everything he had learned to find a style of his own. For instance, he varied his brushwork from dots and specks to larger strokes. In this painting, that technique is most clearly visible in the tree.",
        "references": []
    }
}

