DESCRIPTION:
{
    "tittle": "Fishing Boats on the Beach at Les Saintes-Maries-de-la-Mer",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " Arles",
        "date": " June 1888"
    },
    "description": {
        "medium": "oil on canvas",
        "dimensions": "65 cm x 81.5 cm"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "Can you see why these fishermen's boats appear slightly unreal? Compared to the irregular surface of the sandy beach, they've been painted in an overly two-dimensional way. The boats are made up of areas of uniform colour within strong outlines. Furthermore, the boats don't cast shadows on the beach. These stylistic elements were familiar to Van Gogh from his collection of Japanese prints. Van Gogh would have preferred to make this painting on the beach, but he couldn't, because the fishermen put out to sea very early every morning. He did draw the boats there, however, and later made this painting at home.",
        "references": []
    }
}

