DESCRIPTION:
{
    "tittle": "Portrait of Camille Roulin",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " Arles",
        "date": " November-December 1888"
    },
    "description": {
        "medium": "oil on canvas",
        "dimensions": "40.5 cm x 32.5 cm"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "During his time in Arles (FR), Van Gogh wanted to paint 'modern' portraits that did justice to the sitter's character. 'I seek it by way of colour, ' he wrote to his sister Willemien. The blue of the cap, the green and red of the coat and the yellow of the background are all echoed in Camille's face. Camille was the youngest son of the postman Joseph Roulin, a friend of Van Gogh's. Vincent always had a hard time finding models. It was a stroke of luck that the Roulins agreed to sit for him. He painted more than twenty portraits of the family. Van Gogh made two versions of his portrait of Camille. He sent this one to Theo and gave the other one to the Roulins.",
        "references": [
            {
                "text": "he wrote",
                "link": "http://vangoghletters.org/vg/letters/let902/letter.html"
            }
        ]
    }
}

