DESCRIPTION:
{
    "tittle": "The Pink Orchard",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " Arles",
        "date": " beginning of April 1888"
    },
    "description": {
        "medium": "oil on canvas",
        "dimensions": "65.0 cm x 81.0 cm"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "When Van Gogh arrived in Arles (FR) in February 1888, winter still held the village in its grip. After a few weeks, spring came. Full of enthusiasm, he began a series of studies of trees in blossom. When he saw the paintings side by side, he had the idea of combining them into triptychs. In a triptych, three works are combined into one harmonious whole. Van Gogh was familiar with this idea from Japanese prints. Van Gogh went on to produce no fewer than fourteen paintings of fruit trees in blossom in the space of a month. He hoped his orchard paintings would sell. To his brother Theo he wrote, 'You know these subjects are among the ones that cheer everyone up. '",
        "references": [
            {
                "text": "he wrote",
                "link": "http://www.vangoghletters.org/vg/letters/let593/letter.html"
            }
        ]
    }
}

