    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "The tree Van Gogh painted was just a frail little sapling. But filling the whole length and breadth of the canvas with it gives it something majestic. Van Gogh learned this technique of isolating, enlarging and foregrounding a single element of a landscape from Japanese woodcuts. He admired Japanese prints enormously and constantly tried to equal them in his paintings. It was the height of spring. Van Gogh said that he had six paintings of ‘blossoming fruit trees’ on the go. He hoped paintings of this appealing subject would sell well.",
        "references": []
    }
}

