DESCRIPTION:
{
    "tittle": "Wild Roses",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " Saint-Rémy-de-Provence",
        "date": " May-June 1889"
    },
    "description": {
        "medium": "oil on canvas",
        "dimensions": "24.5 cm x 33.5 cm"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "This picture of wild roses may look very pleasant and peaceful, but Van Gogh was actually suffering a severe mental crisis at the time. He had entered the psychiatric clinic in Saint-Rémy-de-Provence as a voluntary patient, hoping to find peace there. As soon as he could, he went out into the gardens to paint or draw. Van Gogh has painted the fragile blossoms naturalistically. But he has treated the green leaves differently. He has turned them into flat areas of plain colour surrounded by heavy blue outlines.",
        "references": []
    }
}

