DESCRIPTION:
{
    "tittle": "A Crab on its Back",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " Paris",
        "date": " August-September 1887"
    },
    "description": {
        "medium": "oil on canvas",
        "dimensions": "38.0 cm x 46.8 cm"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "Van Gogh took the idea of painting a crab from Japanese prints. He had found the same subject there. Vincent and his brother Theo collected colourful Japanese woodcuts. Here, Van Gogh painted the crab in bright shades of red against a green background. He was experimenting with what he called 'the laws of colour' described by the French painter Eugène Delacroix (1798-1863). According to this theory, colours like red and green form a pair. They are known as complementary because, when placed side by side, they both have a stronger effect. Van Gogh was a great admirer of Delacroix and had learned about his colour theory from books by Charles Blanc.",
        "references": [
            {
                "text": "'the laws of colour'",
                "link": "https://www.vangoghmuseum.nl/en/stories/looking-for-contrast#3"
            }
        ]
    }
}

