    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "Van Gogh repeatedly took shoes as his subject. He painted these wooden-soled leather clogs in the southern French town of Saint-Rémy. He was being treated for his psychiatric problems in a clinic and for a short period was reluctant to go outside. He continued to paint, however, as soon as he felt well enough. It was at this time that he painted these clogs. The clogs are shown in close-up, on a rather unnaturally tilted surface. Van Gogh had employed this unusual way of handling perspective before. The meticulous pattern of small stripes also occurs in pictures painted two years previously.",
        "references": [
            {
                "text": "employed this unusual way of handling perspective",
                "link": "https://www.vangoghmuseum.nl/en/collection/s0020V1962"
            },
            {
                "text": "painted two years previously",
                "link": "https://www.vangoghmuseum.nl/en/collection/s0016V1962"
            }
        ]
