DESCRIPTION:
{
    "tittle": "Giant Peacock Moth",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " Saint-Rémy-de-Provence",
        "date": " May-June 1889"
    },
    "description": {
        "medium": "oil on canvas",
        "dimensions": "33.5 cm x 24.5 cm"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "In May 1889 Vincent wrote to his brother Theo, 'Yesterday I drew a very large, rather rare night moth there which is called the death’s head, its coloration astonishingly distinguished: black, grey, white, shaded, and with glints of carmine or vaguely tending towards olive green; it’s very big. To paint it I would have had to kill it, and that would have been a shame since the animal was so beautiful. 'Later he decided to paint the moth after all, using his drawing as a model. Van Gogh called it a 'death's-head moth' and depicted a kind of skull on the back of its body. It was actually a giant peacock moth, however – a species that has only stripes there.",
        "references": [
            {
                "text": "Vincent wrote",
                "link": "http://www.vangoghletters.org/vg/letters/let776/letter.html"
            }
        ]
    }
}

