DESCRIPTION:
{
    "tittle": "Snow-Covered Field with a Harrow (after Millet)",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " Saint-Rémy-de-Provence",
        "date": " January 1890"
    },
    "description": {
        "medium": "oil on canvas",
        "dimensions": "72.1 cm x 92.0 cm"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "After a long period of psychological crisis, Van Gogh had lost his confidence in himself, as a person and as a painter. For a long time, he felt useless and did not even dare to go outside. To build up his self-confidence again, he started copying prints – a common exercise for beginning painters. This painting is a copy of a print by Jean-François Millet (1814-1875). Over the years, the colours have changed dramatically. The contrasts were originally much greater. It is now a bluish-green landscape, against which the black birds (crows or rooks) stand out strongly.",
        "references": []
    }
}

