DESCRIPTION:
{
    "tittle": "The Sheaf-Binder (after Millet)",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " Saint-Rémy-de-Provence",
        "date": " September 1889"
    },
    "description": {
