DESCRIPTION:
{
    "tittle": "Peasant Woman Bruising Flax (after Millet)",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " Saint-Rémy-de-Provence",
        "date": " September 1889"
    },
    "description": {
        "medium": "oil on canvas",
