    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "Van Gogh painted this Peasant Woman Bruising Flax in a carefully balanced range of colours. He didn’t work from a live model, but from a black-and-white print. It was part of a series called Travaux des champs (‘Work in the Fields’), after paintings by Jean-François Millet (1814-1875). He copied all of the prints in the series. Van Gogh was pleased with the result. He wrote to his brother Theo: ‘You’ll be surprised what effect the Travaux des champs take on in colour, it’s a very intimate series of his. ’",
        "references": []
    }
}

