DESCRIPTION:
{
    "tittle": "Peasant Woman Binding Sheaves (after Millet)",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " Saint-Rémy-de-Provence",
        "date": " September 1889"
    },
    "description": {
        "medium": "oil on canvas on cardboard",
        "dimensions": "43.2 cm x 33.2 cm"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "This is one of twenty copies painted by Van Gogh of prints by Jean-François Millet (1814-1875). He made them during his stay in the asylum in Saint-Rémy. By studying the work of Millet and other artists he admired, he attempted to rebuild his self-confidence, which had been seriously damaged by his illness. It was also a way for him to practice figure painting even though he had no models. Van Gogh did not see these works as simple copies, although he did reproduce the scene meticulously. Instead, he regarded them as adaptations of black-and-white prints into colourful paintings. This is like a musician freely interpreting another composer's work.",
        "references": []
    }
}

