    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " Saint-Rémy-de-Provence",
        "date": " October 1889"
    },
    "description": {
        "medium": "oil on canvas",
        "dimensions": "32.2 cm x 23.3 cm"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "This man was a fellow-patient at the psychiatric clinic in Saint-Rémy-de-Provence. Van Gogh wrote to his mother, ‘It is strange that when one is with them for some time and is used to them, one no longer thinks about their being mad. ’ In fact, following a severe crisis in the autumn he had become afraid of the other inmates. Even so, he painted two portraits of them, including this quick oil sketch. Did he do it to overcome his anxiety? The top left-hand corner of the picture was damaged shortly after it was painted. Nobody knows how.",
        "references": [
            {
                "text": "portraits",
                "link": "https://www.vangoghmuseum.nl/en/collection/s0113V1962"
            }
        ]
    }
}

