    "description": {
        "medium": "oil on canvas",
        "dimensions": "45.5 cm x 59.1 cm"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "In Saint-Rémy, Van Gogh needed to do little more than step outside the grounds of the clinic to find himself in the middle of an olive grove. He often sat there painting. This is an oil study he made. He was always looking for new points of view among the crooked tree trunks. In this painting, he has also focused on the contrast between the straight, diagonal lines with which he painted the foreground and the multi-directional, fanning streaks of paint in the trees.",
        "references": []
    }
}

