{
    "tittle": "View of the Alpilles",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " Saint-Rémy-de-Provence",
        "date": " 1890"
    },
    "description": {
        "medium": "oil on canvas",
        "dimensions": "33 cm x 28.5 cm"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (State of the Netherlands"
    },
    "content": {
        "text": "Bluish-purple mountains stand out against the sky. The rugged, bare rock faces contrast with the charm of the flowering trees in the foreground. Van Gogh made this little painting in the walled wheatfield next to the hospital in Saint-Rémy (FR). He could look out of his bedroom window onto that field, with the Alpilles mountain range in the distance. He wrote to Theo, ' I could certainly do an entire series of these Alpilles, for having seen them for a long time now I’ve got used to it a little. '",
        "references": [
            {
                "text": "He wrote",
                "link": "http://vangoghletters.org/vg/letters/let810/letter.html"
            }
        ]
    }
}

