DESCRIPTION:
{
    "tittle": "Entrance to a Quarry",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " Saint-Rémy-de-Provence",
        "date": " June 1889"
    },
    "description": {
        "medium": "oil on canvas",
        "dimensions": "60 cm x 74.5 cm"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "Vincent intended his painting Entrance to a Quarry to be 'matt in colour without looking impressive'. It was the first time since moving to France that he returned to a muted colour palette. In the Netherlands, he had always used sober colours. But since then, he had adopted the bright hues of the Impressionists. This painting turned out very differently from his Dutch works, however, because he used different pigments. While working on this painting, Van Gogh was not feeling well: he sensed an attack of his illness coming on. Nonetheless, he was pleased with the result: 'there's something sad in [it] that's healthy, and that's why it doesn't annoy me. '",
        "references": [
            {
                "text": "'matt in colour without looking impressive'",
                "link": "http://vangoghletters.org/vg/letters/let797/letter.html"
            },
            {
                "text": "he was pleased with the result",
                "link": "http://vangoghletters.org/vg/letters/let805/letter.html"
            }
        ]
    }
}

