        "text": "How do you paint light filtering down between trees? And dappled patches of light on the ground? That is what Van Gogh explores in this study, painted on a cheap piece of canvas. It was a preparatory study for a larger painting of a very similar image. He painted this view between trees in the shady garden of the clinic in Saint-Rémy where he was a patient. He made countless works there, exploring every last corner of the grounds.",
