        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "This Van Gogh painting shows a corner of the garden at the asylum in Saint-Rémy. 'I also have a new one with ivy on the go, ' he wrote to his brother Theo. He had made paintings of the same subject near Paris two years earlier. At first glance, all you can see here are some tree trunks overgrown with ivy and patches of light on the ground. But if you zoom into this painting, you can hardly see anything but a sea of loose brushstrokes. These strokes are mostly short and surprisingly varied in colour. The only longer lines are the outlines of the trees.",
        "references": [
            {
                "text": "he wrote",
                "link": "http://vangoghletters.org/vg/letters/let790/letter.html"
            }
        ]
    }
}

