DESCRIPTION:
{
    "tittle": "Butterflies and Poppies",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " Saint-Rémy-de-Provence",
        "date": " May-June 1889"
    },
    "description": {
        "medium": "oil on canvas",
        "dimensions": "35 cm x 25.5 cm"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "When Van Gogh made this painting he started with the flowers and butterflies and filled in the blue background only afterwards. This is clear from the fact that the broad strokes of blue paint occasionally cover the green stems of the flowers. Van Gogh even left part of the canvas unpainted, with the bare cloth visible. Using various shades of green, he gave depth to the tangle of stems, leaves and petals. Van Gogh skilfully captured the spirit of the delicate poppies. Some of the buds are about to burst open.",
        "references": []
    }
}

