        "place": " Auvers-sur-Oise",
        "date": " June 1890"
    },
    "description": {
        "medium": "oil on canvas",
        "dimensions": "42.2 cm x 29.0 cm"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "This flower still life is not unfinished, even if it looks that way. Van Gogh painted it with loose and clearly rapid brushstrokes, as he was increasingly doing since he went to live in Auvers. He made the flowers only just recognisable and surrounded them with fairly rough blue outlines. He painted the bunch of flowers in the home of his doctor, Paul-Ferdinand Gachet (1828-1909), whom he described as ‘a ready-made friend and something like a new brother’. We even know that he painted it at Gachet’s red table, on which the vase is standing in the picture.",
        "references": []
    }
}

