DESCRIPTION:
{
    "tittle": "Landscape at Twilight",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " Auvers-sur-Oise",
        "date": " June 1890"
    },
    "description": {
        "medium": "oil on canvas",
        "dimensions": "50.2 cm x 101 cm"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "Van Gogh made this evening landscape in the fields near Auvers, with a view of the local castle. He rendered the tangled black branches of the pear trees with a flurry of black brushstrokes. This reinforces the contrast between the dark trees and the luminous yellow sky. The painting seems somewhat like a panorama because of its wide format. It is one metre wide and 50 centimetres high. Starting in June 1890, Van Gogh made a total of thirteen works with these dimensions. All but one are landscapes. He cut the canvases himself from a large roll.",
        "references": []
    }
}

