DESCRIPTION:
{
    "tittle": "View of Auvers",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " Auvers-sur-Oise",
        "date": " May-June 1890"
    },
    "description": {
        "medium": "oil on canvas",
        "dimensions": "50.2 cm x 52.5 cm"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "This work shows part of the village of Auvers-sur-Oise near Paris. Van Gogh spent the last two months of his life there. Throughout the ten years that Van Gogh worked as an artist, he experimented with different ways of applying paint. This landscape shows a large variety of brushstrokes. For the plants in the foreground, he used rounded, flowing brushwork. For the string of coloured roofs in the middle, he used vertical stripes. The green fields beyond the village are areas of nearly uniform colour. The sky is unfinished. He outlined the clouds with a few swift streaks of blue.",
        "references": []
    }
}

