DESCRIPTION:
{
    "tittle": "View of the Sea at Scheveningen",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " The Hague",
        "date": " August 1882"
    },
    "description": {
        "medium": "oil on paper on canvas",
        "dimensions": "36.4 cm x 51.9 cm"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (State of the Netherlands"
    },
    "content": {
        "text": "Van Gogh made this view of the sea in 1882, while living in The Hague. He went from the city to the seaside to paint a 'nasty little storm'. He did a good job of capturing the dark sky and, in particular, the breaking waves: 'the effect of furrows of ploughed land', he wrote to his brother Theo. Van Gogh dashed off this study quickly. He spread the paint for the white crests of the waves on the canvas unmixed. The strong wind made painting difficult. Grains of sand were blown into the paint all over the canvas. Although this is one of his first oil paintings, Van Gogh's unique brushwork is already easy to recognise.",
        "references": [
            {
                "text": "he wrote",
                "link": "http://vangoghletters.org/vg/letters/let259/letter.html"
            }
        ]
    }
}

