DESCRIPTION:
{
    "tittle": "Two Sowers",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " The Hague",
        "date": " December 1882"
    },
    "description": {
        "medium": "pencil on paper",
        "dimensions": "31.7 cm x 21.2 cm"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "Van Gogh drew this in December 1882. Sowing time was early autumn, so he must have made the drawing from memory (or based it on an earlier sketch). You can see the seeds falling on the field in the foreground. Vincent wrote to Theo wanted to make a series of 30 'Working types': 'sower, digger, woodcutter, ploughman, washerwoman, plus on occasion a cradle or orphan man'. He hoped that a series of prints of working-class figures would sell well.",
        "references": [
            {
                "text": "Vincent wrote",
                "link": "http://vangoghletters.org/vg/letters/let289/letter.html"
            }
        ]
    }
}

