    "tittle": "Old Woman with a Shawl and a Walking Stick",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " The Hague",
        "date": " March 1882"
    },
    "description": {
        "medium": "pencil",
        "dimensions": " pen and ink"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "Van Gogh signed this drawing; he was evidently proud of it. In The Hague, he sometimes went out with the painter Breitner (1857-1923). In March 1882 he wrote to Theo about this drawing, 'Yesterday evening I went out with him to look for figure types in the street in order to study them later in the studio with a model. In that way I drew an old woman I’d seen in the Geest district where the madhouse is. '",
        "references": [
            {
                "text": "he wrote",
                "link": "http://www.vangoghletters.org/vg/letters/let207/letter.html"
            }
        ]
    }
}

