DESCRIPTION:
{
    "tittle": "The Poor and Money",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " The Hague",
        "date": " September-October 1882"
    },
    "description": {
        "medium": "chalk",
        "dimensions": " watercolour"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "'DRAWING FOR NATIONAL LOTTERY TODAY', says the sign on the wall. Many people have showed up for the event. Vincent wrote to his brother Theo that he saw this scene on a rainy day in The Hague. He was moved by the vain hope of these shabbily dressed 'poor souls'. Would the hard-earned money they spent on lottery tickets gain them anything at all? This thought inspired the title The Poor and Money. Vincent had commented on portraying groups in an earlier letter: 'how hard it is to get life and movement into it, and to get the figures in place and separate from each other.",
        "references": [
            {
                "text": "in an earlier letter",
                "link": "http://vangoghletters.org/vg/letters/let264/letter.html"
            }
        ]
    }
}

