DESCRIPTION:
{
    "tittle": "Soup Distribution in a Public Soup Kitchen",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " The Hague",
        "date": " March 1883"
    },
    "description": {
        "medium": "chalk",
        "dimensions": " brush and paint"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "Van Gogh saw soup being distributed at the public soup kitchen in The Hague and made sketches on the spot. Later he produced this drawing, slightly modifying the scene. He did so in his studio, using models. So the scene in the picture is actually staged. The woman on the right can be identified as Sien – a former prostitute with whom Van Gogh live for a time. She posed for him quite often, as did her daughter, here wearing the white bonnet. The baby on the left is probably her other child.",
        "references": [
            {
                "text": "Sien",
                "link": "https://www.vangoghmuseum.nl/en/collection/d0777V1980"
            }
        ]
    }
}

