        "text": "The first thing that strikes you about this landscape is the low light of the setting sun. Van Gogh achieved this effect through the use of white paint, while he drew the rest of the picture in pencil and brown ink. The dark figures on the dimly lit field stand out sharply against the brightly illuminated horizon. Van Gogh had gone to spend a couple of months in Drenthe in the autumn of 1883. Fellow-artists had told him about the beauty of the landscape. And although he sometimes felt that the heathland was ‘as irritatingly tedious and fatiguing as the desert’ in the clear light of day, in the low evening light he found it ‘sublime’.",
        "references": []
    }
}

