DESCRIPTION:
{
    "tittle": "Weaver, with a Baby in a High Chair",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " Nuenen",
        "date": " January 1884"
    },
    "description": {
        "medium": "pencil",
        "dimensions": " pen and ink"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "Van Gogh’s parents lived in the Brabant village of Nuenen, which was the workplace of many weavers. Van Gogh had been keen to draw and paint them for quite some time. He felt the subject was a gap in the market, since it had received almost no attention from other artists. There was little room to draw inside the cramped weavers’ cottages. Even so, Van Gogh often made sketches. One eyewitness reported that he sometimes had to sit in the passageway to do so. Finished drawings like this were made later, in his studio.",
        "references": []
    }
}

