    "tittle": "Winter Garden",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " Nuenen",
        "date": " March 1884"
    },
    "description": {
        "medium": "pencil",
        "dimensions": " pen and ink"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "This is a view of the back garden behind Van Gogh's childhood home in Nuenen, in the Dutch province of North Brabant. The village's old church tower can be seen in the distance. The bushes on the right have been wrapped in straw for protection from the cold. This is a large drawing, more than half a metre wide. Van Gogh gave the twisty fruit trees angular branches. He carefully chose where to place the woman, who forms the only dark accent in the composition. In a letter, he called this figure 'a black apparition'.",
        "references": [
            {
                "text": "old church tower",
                "link": "https://www.vangoghmuseum.nl/en/collection/s0002V1962"
            },
            {
                "text": "In a letter, he called this figure",
                "link": "http://vangoghletters.org/vg/letters/let437/letter.html"
            }
        ]
    }
}

