DESCRIPTION:
{
    "tittle": "The Kingfisher",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " Nuenen",
        "date": " March 1884"
    },
    "description": {
        "medium": "pencil",
        "dimensions": " pen and brush and ink"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam"
    },
    "content": {
        "text": "You have to know the title of this large painting to find the subject. Just above the tufted reeds, a small figure is plunging towards the water at full speed: a kingfisher. Van Gogh used pen and ink over a preliminary drawing in pencil. He added a few accents in opaque white paint for the frost-covered plants along the bank. There is also a little white on the kingfisher's wings. Van Gogh signed this drawing and sent it to the artist Anthon van Rappard (1858-1892). Soon afterwards, he sent him the poem by Jules Breton (1827-1906) on which the scene is based.",
        "references": []
    }
}

