DESCRIPTION:
{
    "tittle": "Head of a Woman",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " Nuenen",
        "date": " December 1884-May 1885"
    },
    "description": {
        "medium": "chalk on paper",
        "dimensions": "40.2 cm x 33.3 cm"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "Van Gogh painted many peasants, often picking the most striking ones as models. He valued their 'primitive', unrefined country life and gave them sharp faces that tell of hard work and poverty. In the winter of 1884-1885, Van Gogh made a large series of drawings and paintings in Nuenen (NL): studies of heads. This portrait of a local farm worker with fairly coarse features was an ambitious drawing. It is twice the size of the other drawings in the series.",
        "references": []
    }
}

