DESCRIPTION:
{
    "tittle": "Head of a Man",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " Nuenen",
        "date": " December 1884-January 1885"
    },
    "description": {
        "medium": "pencil",
        "dimensions": " pen"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "This is just a small drawing – about the size of a postcard. Van Gogh signed it at bottom left, something he did only when he was completely satisfied with a piece. Was he hoping it might find a use as a magazine illustration? He often remarked that such illustrations might one day be a good source of income. If you look closely at on the man’s cheek, you can see the pencil lines of the preparatory sketch. Van Gogh has drawn over them in ink. The murky background is enlivened by a novel kind of spatter technique.",
        "references": []
    }
}

