DESCRIPTION:
{
    "tittle": "Sale of Building Scrap",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " Nuenen",
        "date": " May 1885"
    },
    "description": {
        "medium": "chalk or charcoal",
        "dimensions": " watercolour"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "'The old tower in the fields is being demolished. There was a sale of woodwork and slates and old iron, including the cross. I’ve finished a watercolour of it, ' Vincent wrote to Theo from Nuenen, in the Dutch province of North Brabant. A public sale was held of the scrap materials from the demolition of the local church tower. The iron cross from the church spire – originally purchased by the mayor himself – lies on the ground to the right. The mayor himself, Jan van Hombergh, is also in the picture. He stands beside the doorway in his top hat. The man in uniform is Constable Johannes Biemans.",
        "references": [
            {
                "text": "Vincent wrote",
                "link": "http://vangoghletters.org/vg/letters/let502/letter.html"
            }
        ]
    }
}

