DESCRIPTION:
{
    "tittle": "Stooks and a Mill",
    "authorship": {
        "name": "Vincent van Gogh (1853 - 1890)",
        "place": " Nuenen",
        "date": " August 1885"
    },
    "description": {
        "medium": "chalk on paper",
        "dimensions": "44.3 cm x 56.3 cm"
    },
    "credits": {
        "holder": " Van Gogh Museum",
        "place": " Amsterdam (Vincent van Gogh Foundation)"
    },
    "content": {
        "text": "In early 1885, Vincent had hardly any time for Theo, who had planned to visit him in Nuenen (NL). He wrote: 'I’m rather busy, since they’re harvesting the wheat in the fields and, as you know, this takes only a few days and is certainly almost the most beautiful of all. ' So he invited his brother to come and see him while he was at work in his studio. This drawing shows sheaves of grain drying after the harvest. Van Gogh used milk as a fixative for the chalk drawing, so that the chalk would not come off. Then he used a rubber to make some parts lighter.",
        "references": [
            {
                "text": "He wrote",
                "link": "http://vangoghletters.org/vg/letters/let522/letter.html"
            }
        ]
    }
}

